  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset contains manufacturing and
  export numbers for pistols, revolvers, rifles, shotguns, and miscellaneous firearms
  from 1990 to 2012. All Federally licensed manufacturers of firearms and destructive
  devices are required to submit a production report of manufacturing and export activity
  to ATF. ATF compiles the submitted data and releases it each January, with a one
  year delay to comply with the Trade Secrets Act. Note: 2006-2011 have blank cells
  instead of 0's where info wasn't available.\",\n\t\"license_title\": \"License Not
